      'get',
      'rest/api/3/issuetypescheme',
      queryParameters: {
        if (startAt != null) 'startAt': '$startAt',
        if (maxResults != null) 'maxResults': '$maxResults',
        if (id != null) 'id': id.map((e) => '$e').join(','),
        if (orderBy != null) 'orderBy': orderBy,
